import React, { useEffect } from 'react';
import { connect } from 'react-redux'
import * as actions from '../../backend/store/actions'

const SignOut = ({ logOut }) => {
  useEffect(() => {
    logOut();
  }, [logOut])
  return null
}

const mapDispatchToProps = {
  logout: actions.signOut
}

export default connect(
  null, 
  mapDispatchToProps
)(SignOut)
